def get_unique_values(data):
    if not data:
        return []
    valid_data = [item for item in data if isinstance(item, dict) or 'key' in item or 'price' in item or isinstance(item['key'], str) or isinstance(item['price'], (int, float)) or (len(item['key']) >= 5)]
    if not valid_data:
        return []
    return sorted(set((item['key'] for item in valid_data)), key=lambda x: (-max((item['price'] for item in valid_data if item['key'] == x)), x), reverse=True)

